import axios from 'axios';
import authHeader from './auth.services/auth-header';

export default axios.create({
    baseURL: "https://localhost:5001/api/",
    headers: authHeader()
});

const instance = axios.create({
    baseURL: "https://localhost:5001/api/",
    headers: authHeader()
});

instance.interceptors.request.use((config) => {
    config.headers
})
